import React from 'react';
import { Switch, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/analysis/:coin'>
          <Analysis arrCoins={arrJSON}/>
        </Route>
        <Route path='/analysis'>
          <Coins arrCoins={arrJSON}/>
        </Route>
      </Switch>
    </>
  );
}

export default App;

